import React  from 'react';
import './App.css';
import FormProject from './components/form-project';
import { Routes, Route } from 'react-router-dom';


export default function App() {

  return (
    <div className="App">
      <Routes>
        <Route element={<FormProject />} path="/" exact/>
      </Routes>  
    </div>
  );
}
